:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK, William Williams and McELLIGOT, Rosamund Jean
  LUDBROOK, William Williams and McELLIGOT, Rosamund Jean (cont...)
  Ludbrook (1/3 share). Hana bought William's share in about 1907 when he left to join his brother, Reginald, on
  the Maori lease, "Wairongomai" at Ruatoria. Messrs King, McIntyre and Broad managed "Pouerua" for Hana until
  about 1918. When Ronald Henry Ludbrook returned from the war, he managed "Pouerua" together with the adjoining
  farm, "Ngaphitu" (1,000 acres), which he inherited from his older brother, Hereward Reginald Ludbrook, who died
  in the war. When brother, Geoffrey Valentine Ludbrook, married in 1927, Ronald moved to "Ngaphitu" and
  Geoffrey managed "Pouerua" for his mother until 1950, when it was sold to Geoffrey and his son, Peter Henry
  Whibley Ludbrook. They kept 1,573 acres and 960 acres were sold to three neighbouring farmers. "Pouerua" was
  farmed by a family company until 1989 when the farm was sold to John F White.
  01> LUDBROOK, Allen Kenneth m on ** ** **** to O'CONNOR, Doris Elizabeth
  b 16.11.1914 d ** **1961
  b ** ** ****
  Allen b. at Wairongomai.
  02> LUDBROOK, Brenda m on 09.05. 1940 to BURDETT, Sidney Hamilton
  b 13.08.1916 d 09.05.1993
  . b 04.01.1904 d 16.03.1977.
  Brenda b. at "Waiorongomai" station and m. at Gisborne. Sidney, s/o CH Burdett and Lillian Grace Haig, b.
  at Waipiro Bay and d. at Auckland. Address: PO Box 84, Opotiki.
  Brenda was educated at a convent in Napier and was in Napier during the 1931 earthquake. She was always
  active in community affairs in and around Ruatoria and was made a life member of the Country Women's
  Institute. She served Meals on Wheels up until her death. Her service to the Church was acknowledged by
  the Bishop of Aotearoa through his awarding her the Honour of the Order of Meritorious Service (OMS) for
  outstanding and meritorious service and dedication to the work of the Church, especially amongst the Maori
  people within the Mission of the Hahi Mihinare.
  Sidney was educated at Gisborne Boys' High School (boarder) and was a farmer on "Mangahanea" station at
  Ruatoria. He also had the Ruatoria Saddlery shop in partnership with J Thompson and Son from Gisborne. He
  was a member of the Waiapu County Council (1955-77) and Chairman (1966-77) and was also a member of the
  Poverty Bay Catchment Board. He was awarded the Queen's Service Medal and the Queen's Silver Jubilee Medal
  for public services, 1952-77. He was also a Justice of the Peace and a coroner.
  In his early 20s, Sidney played rugby for East Coast/ Poverty Bay and Hawkes Bay. He was a Maori All Black
  triallist but broke his collar bone during the trials.
  01> BURDETT, William Sidney and FORRESTER, Susie
  b 17.03.1942
  b 26.02.1954
  William b. at Gisborne. Address: PO Box 18, Ruatoria.
  William was educated at Gisborne Boys' High School (boarder). He is a farmer and self-employed
  agricultural contractor. He is a trustee of the Maungahanea Marae, a trustee of the Whakarua Park
  Board, Chairman of the Maungahanea Charitable Trust, a member of the Gisborne Council for Recreation
  and Sport Grant Committee, a member of the Gisborne Prisoners' Aid Rehabilitation Committee, a member
  of the Criminal Justice Advisory Committee, an executive member of the East Coast Rugby Union, Chairman
  of the Ruatoria Rugby Sub-Union and President of the City Rugby and Netball Club. He received the 1990
  Commemoration Medal for community affairs.
  02> BURDETT, John Lloyd
  b 31.01.1944
  John b. at Gisborne. Address: 19 Bridge Street, Opotiki.
  John was educated at Gisborne Boys' High School (boarder). He owns and operates the New World
  Supermarket in Opotiki. He is a Councillor, having served three terms including one term as Deputy
  Chairman. He is a life member of the Opotiki Tennis Club and a member of the Opotiki Hunt Club and
  active in community affairs.
  03>
  BURDETT, Margaret m on 16.07.1971 to HUNT, Gordon Mathew
  b 19.02.1948
  b 17.05.1950
  Margaret b. at Gisborne. Address: PO Box 84, Opotiki.
  Margaret was educated at Gisborne Girls' High School (boarder at Ayton House). She is a teacher and a
